con:configuration.scriptText:
import groovy.xml.XmlSlurper import java.time.LocalDate import java.time.format.DateTimeFormatter import java.text.SimpleDateFormat
def date = new Date() formate="yyyy-MM-dd HH:mm:ss" def sdf = new SimpleDateFormat(formate) date1= sdf.format(date)
def GetPlanExtension = context.expand('${GetPlanExtension#Response}') getPlanExtension = new XmlSlurper().parseText(GetPlanExtension) endTimeInResp=getPlanExtension.Body.GetPlanExtensionResponse.result.endTime.toString() log.info endTimeInResp String endTime=endTimeInResp.replace("T"," ").tokenize('.')[0] log.info endTime date2= new SimpleDateFormat(formate).parse(endTime) date3 = sdf.format(date2) assert date1< date3

